import styled from 'styled-components';

const Label1 = styled.h1`
margin-left: .8%;
margin-top: .1%;
font-size: 175%;
text-align: left;
font-weight: normal;
`

const Container = styled.div`
position: absolute;
margin-top: 20px;
top: 300px;
width: 100%;
height: 50%;
border-bottom: 2px solid black;
border-top: 2px solid black;
`

const IntervalContainer = styled.div`
position: absolute;
bottom: 0%;
left: 0%;
height: 90%;
width: 95%;
border-top: 2px solid black;
border-right: 2px solid black;
overflow: hidden;
overflow-x: scroll;
white-space: nowrap;

`


const IntervalCard = styled.div`
width: 250px;
height: 100%;
border-right: 2px solid black;
display: inline-block;
`
const CardLine1 = styled.div`
position: absolute;
top: 0%;
height: 15%;
width: 100%;
border-bottom: 2px solid black;
`

const CardLine2 = styled.div`

`

const CardLine3 = styled.div`

`

const CardLine4 = styled.div`

`

const CardLine5 = styled.div`

`



const ParkwideIntervals= () => {
    return (
        <Container>
            <Label1>Parkwide Intervals</Label1>
            <IntervalContainer>

                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>
                <IntervalCard></IntervalCard>

            </IntervalContainer>
        </Container>
    )
}

export default ParkwideIntervals
